const TodoForm = () => {
  return (
    <div>
      <form className='TodoForm'>
      <input className='TodoInput' type = 'text' placeholder='what is the task today?'/>
      <button className='todo-btn' type='submit'>Add Task</button>

      </form>
    </div>
  );
};

export default TodoForm;
